/* ------------------------------------------------------ *\
    [functions] initialize
\* ------------------------------------------------------ */
    function initialize(){
        var mapOptions = {
            zoom: level_zoom,
            center: center,//new google.maps.LatLng(24.246965,-102.487335),
            mapTypeId: google.maps.MapTypeId.ROADMAP,
            mapTypeControl:false,
            scrollwheel: false,
            streetViewControl: false,
            panControl: false,
        };

        map = new google.maps.Map(document.getElementById("map_canvas"), mapOptions);

        map.setOptions({styles:maps_stylesArray});

        if(puntos_poligono!=null && puntos_poligono.length!=0) setPoligono();
        if(puntos_mapa!=null && puntos_mapa.length > 0) setPuntos();
    }
/* ------------------------------------------------------ *\
    [functions] setPoligono
\* ------------------------------------------------------ */
    function setPoligono(){
        path = new google.maps.MVCArray();
        bounds_poly = new google.maps.LatLngBounds();

        for(var i=0;i<puntos_poligono.length;i++){
            var punto_poligono = puntos_poligono[i];
            var LatLngPoly = new google.maps.LatLng(punto_poligono.lat,punto_poligono.lng);

            path.insertAt(path.length,LatLngPoly);
            bounds_poly.extend(LatLngPoly);
        }

        center = bounds_poly.getCenter();
        var optionsPoly = {
            strokeColor: color,
            strokeWeight: 1,
            fillOpacity : 0.35,
            fillColor: color,
        }

        polygon = new google.maps.Polygon(optionsPoly);

        polygon.setMap(map);
        polygon.setPaths(new google.maps.MVCArray([path]));
        map.fitBounds(bounds_poly);

        google.maps.event.addListenerOnce(map,'bounds_changed',function(){

            if(typeof(pureScreen) == 'object' && pureScreen.isLt('md')){
                map.panToBounds(bounds_poly);
                console.log('entra');
            }else if(level_zoom!=0){
                map.setZoom(level_zoom);
            }

        });
    }
