    function informacionPunto(marcador){
        google.maps.event.addListener(marcador,'mouseover',function(){

            if(marcador.informacion.capital==0) var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/ciudad-bullet_hover.png', null, null, null, new google.maps.Size(28,43));
            else var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/capital-bullet_hover.png', null, null, null, new google.maps.Size(28,27));

            marcador.setIcon(imageIcon);

            showTooltip(marcador,map);
            $("#link-"+marcador.informacion.id).css({'text-decoration':'underline'});
        });

        google.maps.event.addListener(marcador,'mouseout',function(){

            if(marcador.informacion.capital==0) var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/ciudad-bullet.png', null, null, null, new google.maps.Size(23,34));
            else var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/capital-bullet.png', null, null, null, new google.maps.Size(23,22));

            marcador.setIcon(imageIcon);

            $("#tooltip").css("visibility", "hidden");
            $("#link-"+marcador.informacion.id).attr('style','');
        });

        google.maps.event.addListener(marcador,'click',function(){
             window.location = marcador.informacion.url;
        });

        $("#link-"+marcador.informacion.id).mouseover(function(){

            if(marcador.informacion.capital==0) var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/ciudad-bullet_hover.png', null, null, null, new google.maps.Size(28,43));
            else var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/capital-bullet_hover.png', null, null, null, new google.maps.Size(28,27));

            marcador.setIcon(imageIcon);
            showTooltip(marcador,map);

        }).mouseout(function(){
            if(marcador.informacion.capital==0) var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/ciudad-bullet.png', null, null, null, new google.maps.Size(23,34));
            else var imageIcon = new google.maps.MarkerImage('/imagenes/mapas/capital-bullet.png', null, null, null, new google.maps.Size(23,22));

            marcador.setIcon(imageIcon);
            $("#tooltip").css("visibility", "hidden");
        });
    }
/* ------------------------------------------------------ *\
    [functions] showTooltip
\* ------------------------------------------------------ */
    function showTooltip(marcador,map){
        var x = 0;
        var y = 10;
        var posicion_mapa = $("#map_canvas").offset();

        var scale = Math.pow(2, map.getZoom());
        var nw = new google.maps.LatLng(
            map.getBounds().getNorthEast().lat(),
            map.getBounds().getSouthWest().lng()
        );
        var worldCoordinateNW = map.getProjection().fromLatLngToPoint(nw);
        var worldCoordinate = map.getProjection().fromLatLngToPoint(marcador.getPosition());
        var pixelOffset = new google.maps.Point(
            Math.floor((worldCoordinate.x - worldCoordinateNW.x) * scale),
            Math.floor((worldCoordinate.y - worldCoordinateNW.y) * scale)
        );

        $("#tooltip").html('');

        $('<div id="content-tooltip"></div>').appendTo("#tooltip");
        $('<div id="tool_tit" class="txt-a-c txt-title txt160">'+marcador.informacion.nombre+'<\/div>').appendTo("#content-tooltip");

        if(typeof(marcador.informacion.total_hoteles) != "undefined")
            var string_total = parseInt(marcador.informacion.total_hoteles)>1?marcador.informacion.total_hoteles+' Hoteles':marcador.informacion.total_hoteles+' Hotel';
        else if(typeof(marcador.informacion.total_restaurantes) != "undefined")
            var string_total = parseInt(marcador.informacion.total_restaurantes)>1?marcador.informacion.total_restaurantes+' Restaurantes':marcador.informacion.total_restaurantes+' Restaurante';
        else if(typeof(marcador.informacion.total_atractivos) != "undefined")
            var string_total = parseInt(marcador.informacion.total_atractivos)>1?marcador.informacion.total_atractivos+' Atractivos':marcador.informacion.total_atractivos+' __atractivo__';

        $('<div id="tool_total" class="txt-title txt-a-c gris-medio txt130">'+string_total+'<\/div>').appendTo("#content-tooltip");

        if(marcador.informacion.capital==0){
            $("#tooltip div#tool_tit").removeClass('rojo').addClass('negro');
            y=44;
        }else{
            $("#tooltip div#tool_tit").removeClass('negro').addClass('rojo');
            y=30;
        }

        var tooltip_h = $("#tooltip").outerHeight();
        var tooltip_w = $("#tooltip").outerWidth();

        y_calc = y + tooltip_h;
        x_calc = x + tooltip_w;

        position_item = marcador.getPosition();
        worldCoordinate = map.getProjection().fromLatLngToPoint(position_item);
        pixelOffset = new google.maps.Point(
            Math.floor((worldCoordinate.x - worldCoordinateNW.x) * scale),
            Math.floor((worldCoordinate.y - worldCoordinateNW.y) * scale)
        );

        var x_width;
        var y_height;
        var is_indicacion = false;

        x_width = pixelOffset.x - (x_calc/2);
        y_height = pixelOffset.y - y_calc - 25;

        if(x_width < 0 && pixelOffset.y > 110){
            x_width = pixelOffset.x + 32;
            y_height = pixelOffset.y - (y_calc/2);

            $('<div class="flecha_tooltip_l_izq"><\/div>').prependTo("#tooltip");
            $("div.flecha_tooltip_l_izq").append('<span class="icon-flecha-izquierda"><\/span>').css({'left':'-30px'});
            is_indicacion = true;

        }else if((x_width + x_calc) > $("#map_canvas").outerWidth() &&  (pixelOffset.y < ($("#map_canvas").outerHeight() - 110) && pixelOffset.y > 110)){
            x_width = x_width - (x_calc/2) - 32;
            y_height = pixelOffset.y - (y_calc/2);

            $('<div class="flecha_tooltip_l_der"><\/div>').appendTo("#tooltip");
            $("div.flecha_tooltip_l_der").append('<span class="icon-flecha-derecha"><\/span>').css({'right':'-30px'});
            is_indicacion = true;
        }else{

            if(y_height < 0){
                y_height  = pixelOffset.y + 12;

                if((x_width + x_calc) > $("#map_canvas").outerWidth()){
                    $('<div class="flechas_tooltip"><\/div>').prependTo("#tooltip");
                    $("div.flechas_tooltip").append('<span class="icon-flecha-arriba"><\/span>').css({'left':'36%'});

                }else{
                    $('<div class="flechas_tooltip"><\/div>').prependTo("#tooltip");
                    $("div.flechas_tooltip").append('<span class="icon-flecha-arriba"><\/span>').css({'left':'36%'});
                }

                is_indicacion = true;

            }else if(x_width < 0){
                x_width = pixelOffset.x - (y/2);

                $('<div class="flechas_tooltip"><\/div>').prependTo("#tooltip");
                $("div.flechas_tooltip").append('<span class="icon-flecha-arriba"><\/span>').css({'left':'36%'});

                is_indicacion = true;

            }else if((x_width + x_calc) > $("#map_canvas").outerWidth()){
                x_width = x_width - (x_calc/2) + 10;

                if(y_height > 0){

                    $('<div class="flechas_tooltip_b"><\/div>').appendTo("#tooltip");
                    $("div.flechas_tooltip_b").append('<span class="icon-flecha-abajo"><\/span>').css({'left':'76%'});

                }else{

                    $('<div class="flechas_tooltip"><\/div>').prependTo("#tooltip");
                    $("div.flechas_tooltip").append('<span class="icon-flecha-abajo"><\/span>').css({'left':'0%'});
                }

                is_indicacion = true;
            }

        }

        if(!is_indicacion){
            $('<div class="flechas_tooltip_b"><\/div>').appendTo("#tooltip");
            $("div.flechas_tooltip_b").append('<span class="icon-flecha-abajo"><\/span>').css({'left':'38%'});
        }

        $("#tooltip").css("left", x_width);
        $("#tooltip").css("top",  y_height);
        $("#tooltip").css("display", "block");
        $("#tooltip").css("visibility", "visible");
        $("#tooltip").css("position", "absolute");
    }
